create table YOUTUBER (
	id INT AUTO_INCREMENT PRIMARY KEY,
	email VARCHAR(50),
	password VARCHAR(50),
	name VARCHAR(50),
	nb_videos INT,
	nb_views INT,
	nb_suscribers INT,
	evaluation DECIMAL(2,1)
);
